import React, { Component } from "react";
import { Link } from "react-router-dom";
import "../css/style.css";
import Cookie from "js-cookie";
import axios from "axios";

export default class Home extends Component {
  constructor(props) {
    super(props);

    this.logout = this.logout.bind(this);

    this.state = {
      isLogin: false,
      buttons: "",
    };
  }

  logout() {
    axios
      .get(
        "http://localhost:5000/users/logout?token=" +
          Cookie.get("token") +
          "&userId=" +
          Cookie.get("userId")
      )
      .then((res) => {
        Cookie.remove("token");
        Cookie.remove("userId");
        window.location = "/";
      })
      .catch((err) => {
        /*alert("Error: " + err);*/ //Very strange beacause we considere it has an error but it is not...
        Cookie.remove("token");
        Cookie.remove("userId");
        window.location = "/";
      });
  }

  render() {
    return (
      <div class="home">
        <div class="menu">
          <div class="line1"></div>
          <div class="line2"></div>
          <div class="line3"></div>
        </div>
        <h1>IUS Pre-Registration system</h1>
        <div class="developers">
          <h2>Developed by:</h2>
          <p class="devP">
            <span>Adem Dugalić,</span>
            <span>Axel Stefanini,</span>
            <span>Lejla Mujakić,</span>
            <span>Tarik Muharem,</span>
            <span>Zinedin Hadžajlija</span>
          </p>
        </div>
      </div>
    );
  }
}
